import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./meniu.css";

function Meniu() {
    const navigate = useNavigate();
    const [menuOpen, setMenuOpen] = useState(true); // Stebi meniu atidarymą

    const handleCloseMenu = () => {
        setMenuOpen(false); // Uždaro meniu
        setTimeout(() => {
            navigate("/"); // Grįžta į pagrindinį puslapį po animacijos
        }, 500); // Derinkite su animacijos trukme
    };

    return (
        <div className={`meniu-overlay ${!menuOpen ? "hidden" : ""}`}>
            <img className="logo" src="/nuotraukos/logo.png" alt="Logo" />
            <button className="close-x" onClick={handleCloseMenu}>
                X
            </button>
            <div className="meniu-content">
                <h1>Apie mane</h1>
                <h2>Mano darbai</h2>
                <h3>
                    <span className="flower">
                        <img
                            className="gele_s"
                            src="./nuotraukos/gelyte.png"
                            alt="Flower"
                        />
                    </span>
                    BENDRADARBIAUJAM?{" "}
                    <span className="flower">
                        <img
                            className="gele_s"
                            src="./nuotraukos/gelyte.png"
                            alt="Flower"
                        />
                    </span>
                </h3>
            </div>
        </div>
    );
}

export default Meniu;
